import React from 'react'; 

export default function About(){ 

    return(
        <main className="block col-2">
        <h2>About</h2>
        <p>
            My name is David Kundrats, and I have been a darkroom tech 
            for 4 years. It's always been a goal of mine to have my own 
            fuctioning dark room to make prints and now I can share them with 
            the world. If you have any questions, do not hesitate to reach out to me. 
        </p>
        <div className="row"></div>
        </main>
    )
}
